import './App.css';
import {useState} from 'react'; 


const [userData,setUserData]=useState();

useEffect(()=>{

  fetch('https://jsonplaceholder.typicode.com/users')
      .then(response => response.json())
      .then(json => setUserData(json))
},[])

function App() {
  return (
    <div className="App">
      {userData?.map((val,idx)=>{
        return(<Card/>)
      })}
    </div>
  ) 
}

export default App;
